import React, { useState }  from "react";

function W3SchoolHooksExample () {
    const [color, setColor] = useState("");
    return (

        <div className="flex justify-center items-center w-full min-h-screen bg-sky-200">
            <div className="border border-gray-300 bg-white shadow-md rounded px-8 pt-6  pb-8 mb-4">
            <h1>My favorite color is {color}!</h1>
        <button className="bg-gray-300 rounded shadow-md mt-2 hover:bg-gray-700 hover:text-white px-2 py-1 font-medium"
          type="button"
          onClick={() => setColor("blue")}
        >Blue</button>
        <button className="bg-gray-300 rounded shadow-md mt-2 hover:bg-gray-700 hover:text-white px-2 py-1 font-medium"
          type="button"
          onClick={() => setColor("red")}
        >Red</button>
        <button className="bg-gray-300 rounded shadow-md mt-2 hover:bg-gray-700 hover:text-white px-2 py-1 font-medium"
          type="button"
          onClick={() => setColor("pink")}
        >Pink</button>
        <button className="bg-gray-300 rounded shadow-md mt-2 hover:bg-gray-700 hover:text-white px-2 py-1 font-medium"
          type="button"
          onClick={() => setColor("green")}
        >Green</button>
            </div>
        </div>
    )
}
export default W3SchoolHooksExample;
